
sequence = "AAAACCCGGT"
t1= ""
_dna_complement = {'A': 'T', 'T': 'A', 'C': 'G', 'G': 'C'}


def dna_reverse_complement(seq):
        return "".join([_dna_complement[base] for base in reversed(seq)])


result = dna_reverse_complement(sequence)
#print(result)
assert "ACCGGGTTTT" == result


t_result = dna_reverse_complement(t1)
#print(t_result)

print(dna_reverse_complement("CCAGATC"))